            {value: extendedLeftArm, duration: 35},
            {value: extendedLeftArm, duration: 200},
            {value: originalPath(bpLeftArm), duration: 150},
        ],
        easing: 'linear',
    }, 0);

    punchTl.finished.then(() => bounce.play());
    trackAnimation(punchTl);

    return 50;
}

