        translateY: 0,
        direction: 'alternate',
        easing: 'linear',
        duration: tRecover,
        loop: true,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        targets: image.value!.querySelectorAll('.rightHand'),
        translateY: 0,
        translateX: 0,
        direction: 'alternate',
        easing: 'linear',
        duration: tRecover,
        loop: true,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        targets: image.value!.querySelectorAll('.leftHand'),
        translateY: 0,
        translateX: 0,
        direction: 'alternate',
        easing: 'linear',
        duration: tRecover,
        loop: true,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        targets: image.value!.querySelectorAll('.leftLeg'),
        d: 'M4.038,1152.78C84.0580,1290.335,-29.730,1419.377,-29.730,1419.377',
        direction: 'alternate',
        easing: 'linear',
        duration: tRecover,
        loop: true,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        targets: image.value!.querySelectorAll('.rightLeg'),
        d: 'M-98.476,1193.631C-21.096,1329.627,-168.76,1465.97,-168.76,1465.97',
        direction: 'alternate',
        easing: 'linear',
        duration: tRecover,
        loop: true,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        targets: image.value!.querySelectorAll('.leftFoot, .rightFoot'),
        translateY: 0,
        rotate: 0,
        easing: 'linear',
        duration: tRecover,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        ...restore(bpLeftArm),
        translateY: 0,
        rotate: 0,
        duration: tRecover,
    }, tCrunch + tExtend + tExtended);
    punchTl.add({
        ...restore(bpRightArm),
        translateY: 0,
        rotate: 0,
        duration: tRecover,
    }, tCrunch + tExtend + tExtended);


    punchTl.finished.then(() => bounce.play());

    trackAnimation(punchTl);
    return 400;
}


