function storeOriginalPaths(...elements: SVGPathElement[]) {
    for (const element of elements)
        (element as any)._originalD = element.getAttribute('d');
}

function restore(element: SVGPathElement) {
    return {
        targets: [element],
        d: originalPath(element),
        easing: 'linear'
    }
}

function originalPath(element: SVGPathElement): string {
    return (element as any)._originalD;
}

function trackAnimation(animation: AnimeTimelineInstance) {
    animations.push(animation)
    animation.finished.then(() => {
        animations.splice(animations.indexOf(animation), 1);
        console.log('Done' + animations.length)
    })
    console.log('Tracked' + animations.length)
}

onBeforeUnmount(() => {
    for (const animation of animations) {
        animation.pause();
    }
})

